import React from 'react';

function Navbar() {
    return (   
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <div>
                <a href='/'>Walid</a>
                <li><a href='/'> Home </a></li>
                <li><a href='/Resume'> Resume </a></li>
                <li><a href='/Projects'> Projects </a></li>
            </div>
        </nav>
    );
}

export default Navbar;
